import React, { useState } from "react";
import ResendOTP from "./ResendOTP";
import OTPInput from './Hooks/OTPRender'
import Swal from "sweetalert2";
import './Otp.css'

const OtpInputCard = ({ title, resendOTP, ...rest }) => {

    const [OTP, setOTP] = useState("");
    const handleSubmit = () => {
        if (OTP.length <= 5) {
            Swal.fire({
                icon: 'error',
                text: 'Please Fill all the Filed of Otp ',
              })
        }

    }
    function handleResend(){
        alert("Click")
    }
    return (
        <div
            style={{
                padding: 19,

            }}
        >
            <div style={{ marginBottom: 19 }}>{title}</div>
            <OTPInput value={OTP} onChange={setOTP} {...rest} />
            <div className="box-1">
                <div className="btn btn-one" onClick={handleSubmit}>
                    <span>Continue</span>
                </div>
            </div>
            <div  onClick={handleResend} >
                <ResendOTP/>
                </div>
        </div>
    );
};

function Otp() {

    return (
        <div
            style={{
                display: "flex",
                alignItems: "center",
                flexDirection: "column",
            }}>
            <h2>OTP</h2>
            <div className="container">
                <OtpInputCard
                    autoFocus
                    OTPLength={6}
                    otpType="number"
                    disabled={false}
                    resendOTP={{}}
                />

            </div>
        </div>
    );
}

export default Otp;
